            ))}
             {dataArray.map((row, rowIndex) => (
        <div key={rowIndex} className="row">
          {row.map((_, colIndex) => (
            <Cell
              key={colIndex}
              updateValue={updateValue}
              rowIndex={rowIndex}
              colIndex={colIndex}
            />
          ))}
        </div>
      ))}
        </div>
    )
}
